You might have seen in IT5001 that in some languages, functions are first-class objects. This gives rise to higher-order functions which support code re-use . Higher-order functions can receive functions as arguments and/or return functions as output. In the following program fragment, the map method of Trees receive a function and returns a new tree with the function applied to all of its values. We then also curry the add function so that it receives the first addend, then returns a function that receives the second addend and returns the sum. This way, adding 2 to the values of a tree is as simple as several function calls: # Python
@dataclass(frozen=True)
class Tree: def map(self, f): match self: case Leaf(v): return Leaf(f(v)) case Node(v, l, r): newval = f(v) newl = l.map(f) newr = r.map(f) return Node(newval, newl, newr) @dataclass(frozen=True)
class Node(Tree): val: object left: Tree right: Tree @dataclass(frozen=True)
class Leaf(Tree): val: object def add(x): return lambda y: x + y x = Node(1, Leaf(2), Leaf(3))
print(x.map(add(2))) # Node(3, Leaf(4), Leaf(5)) Functional programming languages emphasize this fact and makes it easy and ergonomic to define higher-order functions. For example, in Haskell, functions are automatically curried, and has higher-order functions like map built into the standard library. This makes, for example, adding two to elements of a list, straightforward: main :: IO ()
main = do let x = [1, 2, 3] print (map (+2) x) -- [3, 4, 5] class Eq a where (==) :: a -> a -> Bool

