Let us motivate this need with an example. Suppose we are trying to create a wrapper class called Box{.python}, that contains a single value. As per usual, we have to think about the type of the value it contains. At this point we cannot simply allow the value to be anything , so we shall fix the type of the value to something, say, int{.python}. # Python
@dataclass
class IntBox: value: int However, we may later want a Box{.python} that stores strings. In this case, we will have to define a new class that does so. # Python
@dataclass
class StrBox: value: str Recall one of the core principles in programming: whenever you see a pattern in your code, retain similarities and parameterize differences. Looking at the two Box implementations, you should be able to see that the implementation is virtually identical, and the only difference is the type of value. We have previously been able to parameterize values (regular function parameters), parameterize behaviour (higher-order functions), however, can we parameterize types ? Yes! We can define Box to receive a type parameter a, and allow the value in the box to be of that type a[^4]. # Python 3.12
@dataclass
class Box[a]: value: a This class is a generalized Box class that can be specialized into a specific Box. For example, by replacing a with int{.python} then we recover our IntBox{.python} class with an int{.python} value; replacing a with str{.python} recovers our StrBox{.python} class with a str{.python} value. x: Box[int] = Box[int](1)
y: Box[str] = Box[str]('a')
z: Box[Box[int]] = Box(Box(1))
bad: Box[int] = Box[int]('a') In Python and many Object-Oriented languages, Box is called a generic or parametrically polymorphic class/type. This is one example of a type depending on a type .

